import React, { Component } from 'react';

 class Drinformation extends Component {

    constructor(props){
        super(props);
        this.state={
          doctors:[],
          isLoaded:false,

        };
    }
  componentDidMount(){
    fetch('https://api.betterdoctor.com/2016-03-01/doctors?first_name=Terry&user_key=ff5d654bef674612132ad54458bfb6a5')
    .then( res => res.json())
    .then(json => {
      this.setState({
        isLoaded:true,
        doctors:json,
      })
    })
    .catch(error => console.log(error));
    window.initMap = this.initMap;
    loadMap('https://maps.googleapis.com/maps/api/js?key=AIzaSyBRfODQceddU_9nyDJyCBQ5lSe20loOk2c&v=3&callback=initMap',function () { })

};

//     { doctors.map(doctor =>(
//    <ul> <li key ={doctor.id}>
//      gender {doctor.gender} 
//      last name : {doctor.last_name}
//     </li> </ul> 
//     ))};

  render(){
    //   var {isLoaded,doctors}= this.state;
    // if(!isLoaded){
    //   return <div>app</div> 
      return(
       <div></div>
      );
    }
}

export default Drinformation;
 /**
 * Load the google maps Asynchronously
 * @param {url} url of the google maps script
 */
function loadMap(src,onloadFunction) {
    var ref = window.document.getElementsByTagName("script")[0];
    var script = window.document.createElement("script");
    script.src = src;
    script.async = true;
    script.onerror = loadError;
    if (onloadFunction) { script.onload = onloadFunction; }
    ref.parentNode.insertBefore(script, ref);
  }
  function loadError(oError) {
  alert("Failed to load google map API "+ oError.target.src );
  }
